  console.log(modalShow);

  switch (type) {
    case 'ADD_EMPLOYEE':
      console.log({type});
      return <AddEmployeeModal onAddEmployee = {handleAddEmployee} modalShow = {modalShow} onHandleClose = {onHandleClose} />;
    default:
      return null;
  }
};

export default ModalConductor;
